import React from 'react'
import './App.css';
import AnnocRootApp from './components/AnnocReactApp/AnnocRootApp'
import axios from 'axios';
import Spinner from './components/Utilities/Spiner';


class App extends React.Component{
    constructor(props){
        super(props)
        this.queryCoopBySec = "http://127.0.0.1:8000/api/dashprovider/coopbysecteurs"
        this.state = {JsonData: null, eleveurData :null}
        axios.get(this.queryCoopBySec).then(res=>{
            this.setState({JsonData:res.data});
        })
    }
    render(){
        if(this.state.JsonData!==null){
            return <AnnocRootApp coopData = {this.state.JsonData} eleveurData = {this.state.eleveurData}/>
        }
        return <div className="container d-flex flex-column justify-content-center">
            <Spinner state={true} color = {"#f76fd9"}/>
            <p className ="text-center">Downloading data...</p>
        </div> 
    }
}

export default App
